import React from "react";

const LaboratoryHistory = ({pid}) => {
    const [theLaboratory, setLaboratory] = useState([]);
const [error, setError] = useState(null);
    useEffect(() => {
        axios.get(`http://localhost:8000/patient/api/onepatient/${pid}`)
            .then((res) => {
                console.log(res.data);  // Log the entire response to understand its structure
                if (res.data && res.data.thePatient && Array.isArray(res.data.thePatient.patient_appointments)) {
                    setLaboratory(res.data.thePatient.patient_appointments);
                  
                } else {
                    setLaboratory([]);
                  
                }
            })
            .catch((err) => {
                console.log(err);
                setError('Failed to fetch laboratory results');
                setLaboratory([]);  // In case of error, set to empty array
            });
    }, [pid]);
    return (
        <div>
            Hello po
        </div>
    );
};

export default LaboratoryHistory;
